import { z } from 'zod';
const tabSchema = z.object({
    name: z.string().trim().nonempty(),
    url: z.string().trim().nonempty(),
    version: z.string().optional(),
});
export const tabsSchema = tabSchema.array();
export const primaryTabSchema = z
    .object({
    name: z.string(),
})
    .strict();
